import './App.css';
import Leena from './components/Leena.js';
import Loyalty from './components/Loyalty.js';
import MiniGame from './components/MiniGame.js';
import {Routes, Route} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={ <MiniGame /> } />
